import './App.css';
import React, { useRef } from 'react';
import { BrowserRouter } from 'react-router-dom';

import { Routes, Route } from 'react-router-dom';
import { MyApp } from "./MyApp";





function App() {
  const root = ReactDOM.createRoot(document.getElementById('root'));
  root.render(
    <BrowserRouter>
      <App />
    </BrowserRouter>
  ); 
}

export default App;
